// import '../imports/utils'
import { Meteor } from 'meteor/meteor';
import { Players } from '../imports/api/players';

class Person {
  constructor(name = 'JhonD', age = 0) {
    this.name = name;
    this.age = age;
  }
  getGreeting() {
    return `Hi I am ${this.name}`;
  }
  getPersonDescription() {
    return `Person with name ${this.name}, and he is ${this.age} years old`
  }
}

class Employee extends Person {
  constructor(name, age, title) {
    super(name, age);
    this.title = title;
  }
  getGreeting() {
    if(this.title){
      return `I am ${this.name}, I work as a ${this.title}`;
    }
    else{
      return super.getGreeting();
    }
  }
  hasJob() {
    return !!this.title;
  }
}

Meteor.startup(() => {
  let me = new Employee('Mika', 25, 'db admin');
  console.log(me.getPersonDescription());
});
